import styles from "./MealItem.module.css";

export default function MealItem({ meal }) {
  const price = `$${meal.price.toFixed(2)}`;
  return (
    <li>
      <div>
        <h3>{meal.name}</h3>
      </div>
      <div>{meal.description}</div>
      <div>${meal.price}</div>
    </li>
  );
}
